import java.io.*;
class StudentRank
{
    int m[]=new int [50];
    public void sort()throws IOException
    {
        int i,j;
        int tmp;
        BufferedReader in=new BufferedReader(new InputStreamReader(System.in));
        System.out.println("Enter 50 marks: ");
        for(i=0;i<50;i++)
        {
            m[i]=Integer.parseInt(in.readLine());
        }                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              
        for(i=0;i<49;i++)
        {
            for(j=0;j<49-i;j++)
            {
                if(m[j]>m[j+1])
                {
                    tmp=m[j+1];
                    m[j+1]=m[j];
                    m[j]=tmp;
                }
            }
        }
        for(i=0;i<6;i++)
            System.out.println();
        for(i=0;i<50;i++)
            System.out.println(m[i]);
    }
}
                    
            